DROP TABLE IF EXISTS `pagedata`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `pagedata` (
  `pageid` int(10) NOT NULL AUTO_INCREMENT,
  `review_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `image_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `item_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `average_rating` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `number_of_ratings` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `similar_items` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `item_brand` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createddatetime` datetime DEFAULT CURRENT_TIMESTAMP,
  `createdby` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`pageid`,`review_url`,`image_url`,`item_name`),
  UNIQUE KEY `Composite` (`review_url`,`image_url`,`item_name`)
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
